import React, {useEffect,useState} from 'react'

function FetchApi() {
    
    const [details, setdetails] = useState(JSON.parse(localStorage.getItem('usreInfo')||"[]"));
    useEffect(() => {
        fetch('https://randomuser.me/api/?results=10')
        .then((info)=>{
            info.json().then((details)=>{
                details.results.map(obj =>{
                  obj.amount = {
                    "salary" : "$100000",
                    "expense" : "[]"
                  }
                })
                console.log(details.results);
                setdetails(details);
                localStorage.setItem('userDetail',JSON.stringify(details.results));
            })
        })
    }, [])
    

  return (
    <div>
        {
          (details.length>0) && details.map((obj)=>(
            <div>
              <h4>{obj.name.first}</h4>
            </div>
          ))
        }
    </div>
  )
}

export default FetchApi
